Sure, here's the algorithm implemented in Java:
```java
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

// Define a class for Hotel metadata
class HotelMetadata {
    public int id;
    public String url;
    public int stars;
    public String photo;

    public HotelMetadata(int id, String url, int stars, String photo) {
        this.id = id;
        this.url = url;
        this.stars = stars;
        this.photo = photo;
    }
}

public class HotelSearchService {
    // Initialize the hashmap
    private Map<String, HotelMetadata> hotelMap;

    public HotelSearchService() {
        this.hotelMap = new HashMap<>();
    }

    // Populate the hashmap with hotel data
    public void addHotel(HotelMetadata metadata, String name) {
        this.hotelMap.put(name, metadata);
    }

    // Search for hotels with a given prefix
    public List<HotelMetadata> searchHotels(String prefix) {
        List<HotelMetadata> matchingHotels = new ArrayList<>();

        // Iterate over each key in the hashmap
        for (Map.Entry<String, HotelMetadata> entry : this.hotelMap.entrySet()) {
            String name = entry.getKey();
            HotelMetadata metadata = entry.getValue();

            // Check if the key (i.e. hotel name) starts with the prefix
            if (name.startsWith(prefix)) {
                matchingHotels.add(metadata);
            }
        }

        return matchingHotels;
    }
}
```
