Here are the steps to grant access to an external SharePoint site using the "Azure AD Application" method in C#:

1. Register the Azure AD application: Register your Azure AD application in the Azure portal, and configure it to have the necessary permissions to access the external SharePoint site.
2. Obtain an access token: Use the Azure AD application's client ID and client secret to obtain an access token from the Azure AD token endpoint. You can also use a user account's credentials to obtain an access token if the SharePoint site requires user authentication.
3. Use the access token to access the SharePoint site: Pass the obtained access token as an authorization header in the HTTP request when accessing the SharePoint site's REST API.

Here's an example of how to obtain an access token in C# using a user account's credentials:
```csharp
string tenantId = "your-tenant-id";
string clientId = "your-client-id";
string userName = "your-user-name";
string password = "your-password";
string resource = "https://your-sharepoint-site.sharepoint.com";

string tokenEndpoint = $"https://login.microsoftonline.com/{tenantId}/oauth2/token";

using (var client = new HttpClient())
{
    var requestBody = new Dictionary<string, string>
    {
        { "grant_type", "password" },
        { "client_id", clientId },
        { "resource", resource },
        { "username", userName },
        { "password", password }
    };

    var request = new HttpRequestMessage(HttpMethod.Post, tokenEndpoint)
    {
        Content = new FormUrlEncodedContent(requestBody)
    };

    var response = await client.SendAsync(request);
    response.EnsureSuccessStatusCode();

    var responseContent = await response.Content.ReadAsStringAsync();
    var responseData = JsonConvert.DeserializeObject<Dictionary<string, string>>(responseContent);
    string accessToken = responseData["access_token"];
}
```
With the obtained access token, you can now use it to access the external SharePoint site using the SharePoint REST API.

