Linear search and binary search are both algorithms used to search for a specific value in a given data set. However, they differ in their efficiency and the type of data sets they work best with.

A linear search algorithm searches for a given value in a data set by traversing the data set from the beginning to the end, checking each element until the desired value is found or the end of the data set is reached. This algorithm is simple to implement and works well for small data sets, but becomes inefficient for larger data sets.

Here's an example of a linear search algorithm in C:
```c
#include <stdio.h>

int linearSearch(int arr[], int n, int x) {
    int i;
    for (i = 0; i < n; i++) {
        if (arr[i] == x) {
            return i;
        }
    }
    return -1;
}

int main() {
    int arr[] = {1, 3, 5, 7, 9};
    int n = sizeof(arr) / sizeof(arr[0]);
    int x = 7;
    int result = linearSearch(arr, n, x);
    if (result == -1) {
        printf("Element not found");
    } else {
        printf("Element found at index %d", result);
    }
    return 0;
}
```
In this example, the `linearSearch()` function takes an array, the size of the array, and the value to search for as input parameters. It then iterates through the array, checking each element until the desired value is found. If the value is found, the function returns the index of the value, otherwise it returns -1. The main function initializes an array, searches for a value, and prints the result.

A binary search algorithm, on the other hand, works by dividing the data set into halves and repeatedly eliminating the half that cannot contain the desired value, until the desired value is found or the data set is empty. This algorithm is more efficient than linear search for larger data sets, but requires the data set to be sorted in ascending or descending order.

Here's an example of a binary search algorithm in C:
```c
#include <stdio.h>

int binarySearch(int arr[], int l, int r, int x) {
    if (r >= l) {
        int mid = l + (r - l) / 2;
        if (arr[mid] == x) {
            return mid;
        }
        if (arr[mid] > x) {
            return binarySearch(arr, l, mid - 1, x);
        }
        return binarySearch(arr, mid + 1, r, x);
    }
    return -1;
}

int main() {
    int arr[] = {1, 3, 5, 7, 9};
    int n = sizeof(arr) / sizeof(arr[0]);
    int x = 7;
    int result = binarySearch(arr, 0, n - 1, x);
    if (result == -1) {
        printf("Element not found");
    } else {
        printf("Element found at index %d", result);
    }
    return 0;
}
```
In this example, the `binarySearch()` function takes an array, the left and right indices of the sub-array being searched, and the value to search for as input parameters. It first calculates the middle index of the sub-array, and compares the value at the middle index to the desired value. If the value is found, the function returns the index of the value. If the value is greater than the middle value, the function recursively searches the right half of the sub-array, otherwise it recursively searches the left half

