To create a snap-to experience for the infinite scroll video feed, you can use CSS Scroll Snap Points. This will ensure that when the user scrolls through the video feed, each video will snap into place, occupying the entire viewport.

First, in `Home.svelte`, update the `ul` element to use a CSS class named `video-feed`:
```html
<ul id="video-list" class="video-feed">
  {#each videos as video}
    <li>
      <VideoPlayer src="{video.url}" videoId="{video.id}" />
    </li>
  {/each}
</ul>
```
Next, add the following CSS styles to `Home.svelte`:
```css
.video-feed {
  list-style-type: none;
  padding: 0;
  margin: 0;
  width: 100%;
  height: 100vh;
  overflow-y: scroll;
  scroll-snap-type: y mandatory;
  -webkit-overflow-scrolling: touch;
}

.video-feed li {
  display: flex;
  justify-content: center;
  align-items: center;
  min-height: 100vh;
  scroll-snap-align: start;
  scroll-snap-stop: always;
}
```
These styles achieve the following:

1. `.video-feed`: Defines the video feed as a scroll container with a mandatory snap type along the y-axis. This ensures that the scrolling will snap to specific points along the y-axis (defined by the `scroll-snap-align` property of the child elements). The `-webkit-overflow-scrolling: touch;` line provides smooth scrolling for iOS devices.
2. `.video-feed li`: Defines each list item (video) as a snap point using the `scroll-snap-align: start;` property. The `scroll-snap-stop: always;` property ensures the scrolling will always stop at the snap point, even when the user scrolls quickly.

Now, your infinite scroll video feed in `Home.svelte` will have a snap-to experience, with each video snapping into place and occupying the entire viewport as the user scrolls through the feed.

